import { useState, useEffect } from 'react'
import MovieCard from './MovieCard';

function KidsMovieList() {

    const [kidsmovies, setKidsMovies] = useState([])

    useEffect(() => {
        fetch('https://api.themoviedb.org/3/movie/?certification_country=US&certification.lte=G&sort_by=popularity&api_key=9122d3e99f5cf10f65b111a1dcd51b20&language=ru-RU&page=1')
            .then(res => res.json())
            .then(data => {
                setKidsMovies(data.results)
            })
    }, [])

    return (
        <>
            <div className="movie-title title">
                <h1>Movies For Kids</h1>
            </div>
            <div className="movie-list">
                {
                    kidsmovies.map(item => (
                        <MovieCard data={item} />
                    ))
                }
            </div>
        </>
    )
}

export default KidsMovieList;
